"use strict";

function f_gold(scores, ages) {
    let nums = [];
    for (let i = 0; i < ages.length; i++) {
        nums.push([ages[i], scores[i]]);
    }
    nums.sort((a, b) => a[0] - b[0]);
    let n = nums.length;
    let dp = nums.map(num => num[1]);
    for (let i = 0; i < n; i++) {
        for (let j = 0; j < i; j++) {
            if (nums[i][1] >= nums[j][1]) {
                dp[i] = Math.max(dp[i], dp[j] + nums[i][1]);
            }
        }
    }
    return Math.max(...dp);
}
